package cal;

public final class SimpleIntCalc implements Operations<Integer>{

	@Override
	public Integer Add(Integer i, Integer j) {
		// TODO Auto-generated method stub
		return i+j;
	}

	@Override
	public Integer Sub(Integer i, Integer j) {
		// TODO Auto-generated method stub
		return i-j;
	}

	
	
	
	
	
}
